export function PackageItem({ id, tba, weight, items, location, city, driverID }) {

    return (
        <li className="flex justify-evenly flex-wrap">
            <div id="tba" className="border">TBA {tba}</div>
            <div id="weight">Weight{weight}</div>
            <div id="items">Item{items}</div>
            <div id="location">{location}</div>
            <div id="city">City{city}</div>
            <div id="driverID">Driver{driverID}</div>
        </li>

    )
}
